import Square from "./Square";

function App() {
  return (
    <div className="board">
      <Square value="1" />
      <Square value="2" />
      <Square value="3" />
      <Square value="4" />
      <Square value="5" />
      <Square value="6" />
      <Square value="7" />
      <Square value="O" />
      <Square value="X" />
    </div>
  );
}

export default App;
